import React from 'react';
import SearchBar from './SearchBar.jsx';
import '../hoja-de-estilos/Nav.css';

function Nav({ onSearch }) {
  return (
    <div>
      <nav className="navbar">
        <div
          style={{
            display: 'flex',
            width: '100%',
            justifyContent: 'center',
          }}
        >
          <SearchBar onSearch={onSearch} />
        </div>
      </nav>
    </div>
  );
}

export default Nav;
